// DateDisplay.js
import React from 'react';

function DateDisplay() {
  // Get current date
  const currentDate = new Date().toLocaleDateString('en-US', {
    weekday: 'long',
    year: 'numeric',
    month: 'long',
    day: 'numeric'
  });

  return (
    <div>
      <p>Today is {currentDate}</p>
    </div>
  );
}

export default DateDisplay;
